import './directory.styles.scss'

const Directory = () => (
  <div className='directory-menu'>
    {sections.map(({title, imageUrl, id, size, linkUrl}) => (
      <MenuItem key={id} title={title} imageUrl={imageUrl} size ={size} linkUrl={linkUrl}/>
    ))}
  </div>
)

export default Directory;
